oxy_webhelp_navlinks = {"jira-d22908e30330":{"topics":[{"title":"Atlassian Jira instance details","shortdesc":"<p class=\"shortdesc\">The Atlassian Jira details page helps you monitor and analyze your data to view         important details, such the number of backups during a specified time period. You can also         access features from the details page, such as managing protection and restoring         data.<\/p>","href":"jira\/jira_instance_details.html","attributes":{"data-id":"jira_instance_details"},"menu":{"hasChildren":false},"tocID":"jira_instance_details-d22908e30341","topics":[]},{"title":"Viewing details about an Atlassian Jira instance","shortdesc":"<p class=\"shortdesc\">View details about an Atlassian Jira instance to monitor and analyze data and to         access features, such as managing protection.<\/p>","href":"jira\/jira_viewing_details.html","attributes":{"data-id":"jira_viewing_details"},"menu":{"hasChildren":false},"tocID":"jira_viewing_details-d22908e30352","topics":[]},{"title":"Analyzing Atlassian Jira data","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides graphs about snapshot activity for an Atlassian Jira         instance that helps you analyze the point in time to use to restore data when an anomaly is         detected in deleted, changed, or added issues or settings. Analyzing data helps you         understand if and when data was lost and what data was lost.<\/p>","href":"jira\/jira_analyzing_data.html","attributes":{"data-id":"jira_analyzing_data"},"menu":{"hasChildren":false},"tocID":"jira_analyzing_data-d22908e30363","topics":[]},{"title":"Supported Atlassian Jira data types","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> can back up and restore a variety of Atlassian Jira data types,         such as project issues and workflows.<\/p>","href":"jira\/jira_supported_data_types.html","attributes":{"data-id":"jira_supported_data_types"},"menu":{"hasChildren":false},"tocID":"jira_supported_data_types-d22908e30376","topics":[]},{"title":"Supported regions for Atlassian Jira","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides support for Atlassian Jira protection in several         regions. You select the region when you set up the Jira instance in <span class=\"ph\">RSC<\/span>.<\/p>","href":"jira\/jira_regions.html","attributes":{"data-id":"jira_regions"},"menu":{"hasChildren":false},"tocID":"jira_regions-d22908e30389","topics":[]},{"title":"Oauth authentication for Atlassian Jira site connection","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> uses OAuth to connect to the Atlassian Jira sites that you want         to back up. You must use a Jira user or a Jira service account with the appropriate         permissions.<\/p>","href":"jira\/jira_oauth_authentication.html","attributes":{"data-id":"jira_oauth_authentication"},"menu":{"hasChildren":false},"tocID":"jira_oauth_authentication-d22908e30405","topics":[]},{"title":"Required RBAC permissions for Atlassian Jira","shortdesc":"<p class=\"shortdesc\">Accessing Atlassian Jira protection features within <span class=\"ph\">RSC<\/span> requires the         appropriate RBAC permissions. You can use the default Jira Admin role or a custom         role.<\/p>","href":"jira\/jira_rbac_required_permissions.html","attributes":{"data-id":"jira_rbac_required_permissions"},"menu":{"hasChildren":false},"tocID":"jira_rbac_required_permissions-d22908e30418","topics":[]},{"title":"Adding an Atlassian Jira instance","shortdesc":"<p class=\"shortdesc\">Add an Atlassian Jira instance of the Jira site that you want to back up and restore.         For example, you can back up and restore data types such as projects, workflows, and issues.         You can add more Jira instances if your have multiple sites that you want to         protect.<\/p>","href":"jira\/jira_adding_instance.html","attributes":{"data-id":"jira_adding_instance"},"menu":{"hasChildren":false},"tocID":"jira_adding_instance-d22908e30432","topics":[]},{"title":"Removing Jira instances","shortdesc":"<p class=\"shortdesc\">Remove a Jira instance to remove all snapshots and configurations from <span class=\"ph\">RSC<\/span>.<\/p>","href":"jira\/jira_deleting_instance.html","attributes":{"data-id":"jira_deleting_instance"},"menu":{"hasChildren":false},"tocID":"jira_deleting_instance-d22908e30443","topics":[]},{"title":"Reauthenticating your Atlassian Jira account","shortdesc":"<p class=\"shortdesc\">Reauthenticate your Atlassian Jira account when Jira revokes authentication after a         period of time or when the account used to authenticate is no longer active in the Jira         site.<\/p>","href":"jira\/jira_reauthenticate.html","attributes":{"data-id":"jira_reauthenticate"},"menu":{"hasChildren":false},"tocID":"jira_reauthenticate-d22908e30457","topics":[]},{"title":"Atlassian Jira protection using SLA Domains","shortdesc":"<p class=\"shortdesc\">You can manage protection for Atlassian Jira sites by using SLA Domains. SLA Domains         provide protection policies for your sites so that you can securely back up and restore         data.<\/p>","href":"jira\/jira_protection_sla_domain.html","attributes":{"data-id":"jira_protection_sla_domain"},"menu":{"hasChildren":false},"tocID":"jira_protection_sla_domain-d22908e30469","topics":[]},{"title":"Atlassian Jira backups","shortdesc":"<p class=\"shortdesc\">You can securely back up your Atlassian Jira data types with snapshots and restore         your data from those snapshots. You can back up data such as tasks and subtasks and restore         that information if the data is compromised.<\/p>","href":"jira\/jira_backups.html","attributes":{"data-id":"jira_backups"},"menu":{"hasChildren":false},"tocID":"jira_backups-d22908e30480","next":"jira_backups-d22908e30480"},{"title":"Atlassian Jira recovery","shortdesc":"<p class=\"shortdesc\">You can restore data for your Atlassian Jira issues and Jira settings  to their         original location from any point-in-time snapshot.<\/p>","href":"jira\/jira_recovery.html","attributes":{"data-id":"jira_recovery"},"menu":{"hasChildren":false},"tocID":"jira_recovery-d22908e30502","next":"jira_recovery-d22908e30502"}]}};